    '/photos/wine-night/egirls june 2025-100.webp',
    '/photos/wine-night/egirls june 2025-101.webp'
  ];

  useEffect(() => {
    const handleResize = () => {
      setWindowSize({
        width: window.innerWidth,
        height: window.innerHeight
      });
    };

    window.addEventListener('resize', handleResize);
    return () => window.removeEventListener('resize', handleResize);
  }, []);

  const handleTouchStart = (e) => {
    setIsDragging(true);
    setDragStart(e.touches[0].clientX);
  };

  const handleTouchMove = (e) => {
    if (!isDragging) return;

    const currentX = e.touches[0].clientX;
    const diff = dragStart - currentX;

    if (Math.abs(diff) > 50) {
      if (diff > 0) {
        // Swipe left - next photo
        setCurrentIndex((prev) => (prev + 1) % wineNightPhotos.length);
      } else {
        // Swipe right - previous photo
        setCurrentIndex((prev) => (prev - 1 + wineNightPhotos.length) % wineNightPhotos.length);
      }
      setIsDragging(false);
    }
  };

  const handleTouchEnd = () => {
    setIsDragging(false);
  };

  const nextPhoto = () => {
    setCurrentIndex((prev) => (prev + 1) % wineNightPhotos.length);
  };

  const prevPhoto = () => {
    setCurrentIndex((prev) => (prev - 1 + wineNightPhotos.length) % wineNightPhotos.length);
  };

  return (
    <div className="photos-page">
      <div className="photos-header">
        <div className="macos-window-controls">
          <div className="control red"></div>
          <div className="control yellow"></div>
          <div className="control green"></div>
        </div>
        <div className="macos-title">Photos - egirls.faith</div>
      </div>

      <div className="photos-content">
        <div className="photo-container"
             onTouchStart={handleTouchStart}
             onTouchMove={handleTouchMove}
             onTouchEnd={handleTouchEnd}>
          <img 
            src={wineNightPhotos[currentIndex]} 
            alt={`Photo ${currentIndex + 1}`}
            className="current-photo"
          />

          <div className="photo-navigation">
            <button onClick={prevPhoto} className="nav-button prev">
              ‹
            </button>
            <span className="photo-counter">
              {currentIndex + 1} / {wineNightPhotos.length}
            </span>
            <button onClick={nextPhoto} className="nav-button next">
              ›
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default PhotosPage;
